import React from 'react';
import { Link } from "react-router-dom";

function Card({image, name, continent}) {

  return (

    <div>
      <h3>Pais: {name}</h3>
      <h3>Continente: {continent}</h3>
      <Link to='/detail'>
      <img src={image} alt='No hay imagen'/>
      </Link>
    </div>
  )
}

export default Card;
